import React from "react"
import { useHistory, Link } from "react-router-dom";
import kanye from "../img/kanye.png"
import '../App.css'

class Home extends React.Component{
    constructor(props) {
        super(props);
        this.state = { 
            windowWidth: window.innerWidth,
            windowHeight: window.innerHeight,
            kanyeStyle: {
                position: "absolute",
                left: "300px",
                top: "700px",
            }
        };
      }

    render() {
        return(
            <div class="h-screen w-screen bg-background">
                <a href="" class="kanyePosition" style={this.state.kanyeStyle}>
                    <img src={kanye} alt="" class="h-12 w-16"/>
                </a>
            </div>
        )
    }
}

export default Home
